import {Links} from "./ProjectData"

import Header from "./Header.js"

export default function JamLink() {
    return (
 
  <div>
     <Header type = {"UX/UI Design"} title = {"JamLink"} desc = {"View Prototype"} src = {"./content/Images-JamLink/jamLink.jpg"}/>
     <div className = "page-content">
      <div className = "content-flex">
      <CurrentLinks />
      </div>
     </div>
  </div>
    );
   
}
